import React, { ReactElement } from "react";
import { IRootObject } from '../interfaces';

interface StockResultProps {
    stockJSON: IRootObject
}

function StockResultDisplay(props: React.PropsWithChildren<StockResultProps>):ReactElement {
    if (props.stockJSON) {
        return (
            <div id="StockResultDisplay">
                <table>
                    <thead>
                        <tr><td>{props.stockJSON.companyName}: ${props.stockJSON.symbol}</td></tr>
                    </thead>
                    <tbody>
                        <tr><td>Latest Price:</td><td> {props.stockJSON.latestPrice}</td></tr>
                        <tr><td>52 Week High:</td><td> {props.stockJSON.week52High}</td></tr>
                        <tr><td>52 Week Low:</td><td> {props.stockJSON.week52Low}</td></tr>
                        <tr><td>P/E Ratio:</td><td> {props.stockJSON.peRatio}</td></tr>
                        <tr><td>Market Cap:</td><td> {props.stockJSON.marketCap}</td></tr>                        
                    </tbody>
                </table> 
         </div>
        )
    } else {
        return (
            <div>
                <p>{props.stockJSON}</p>
            </div>
        )
    }
}


export default StockResultDisplay;
